import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div>
      <h1>WELCOME THIS IS HOME</h1>
      <Link to={"/today"}>Go to Today List</Link>
      <Link to={"/seven"}>Go to Seven days list</Link>
      <Link to={"/important"}>Go to Important List</Link>
    </div>
  );
};

export default Home;
